"use strict";(self.webpackChunkcdp_docs=self.webpackChunkcdp_docs||[]).push([[7836],{1341:a=>{a.exports=JSON.parse('{"label":"Data Lifecycle","permalink":"/doc/docs/tags/data-lifecycle","allTagsPath":"/doc/docs/tags","count":2,"items":[{"id":"learning_center/data_catalogs","title":"Data Catalogs","description":"A data catalog in higher education administration refers to a centralized repository or system that organizes and manages metadata and information about the various data assets within an institution. It provides a comprehensive inventory of data sources, datasets, data definitions, data owners, and other relevant information to facilitate data discovery, understanding, and governance.","permalink":"/doc/docs/learning_center/data_catalogs"},{"id":"learning_center/data_collection","title":"Data Collection","description":"The CDP (Common Data Platform) utilizes Fivetran to extract and load data from campus information systems, which are the sources of data. The extracted data is loaded into Snowflake, which serves as the foundational layer in the CDP. Fivetran continuously syncs data from the campus information systems into the Data Lake. This continuous syncing ensures that the most recent data from the campus information systems is available for analysis and usage within the CDP.","permalink":"/doc/docs/learning_center/data_collection"}]}')}}]);